import React, { Component } from "react";

class Counter extends Component {
  state = {
    count: 1,
    tags: ["item1", "item2", "item3", "item4"]
  };

  render() {
    return (
      <React.Fragment>
        <ul>
          {this.state.tags.map(tag => (
            <li key={tag}>{tag}</li>
          ))}
        </ul>
      </React.Fragment>
    );
  }
}

export default Counter;
